import Vue from "vue";
import VueRouter from "vue-router";
import router from "@/router/index.js";
import App from "@/App.vue";
import '@fortawesome/fontawesome-free/css/all.css';
Vue.config.productTip=false;
Vue.use(VueRouter);


new Vue({
  router, // 确保这里包含了 router
  render: h => h(App),
}).$mount('#app');
